import React from 'react';
import Layout from './Layout';
import './App.css';

function App() {
  return (
    <Layout>
      <h2>WELCOME TO THE</h2>
      <h1><span>PHOTOGRAPHY</span></h1>
      <h1> STORE</h1>
      <h3>All photos taken by Doug Schallmoser</h3>
    </Layout>
  )
}

export default App;
